import React from 'react';

import { Context } from '../context/GlobalState';

const SendMessage = props => {

  return (
    <Context.Consumer>
    {context => (
      <form>
        <input disabled={context.openRoom.hasOwnProperty('id')} type="text"/> <button>send</button>
      </form>
    )}
    </Context.Consumer>
  )

}

export default SendMessage
